import bannerImage from "../styles/DSCF1113.jpeg";
import eliseAtComputer from "../styles/EliseAtComputerSAP.jpg";
import eliseAtWhiteboard from "../styles/EliseAtWhiteboardSAP.jpg";
import eliseWithSAPLogoTeeth from "../styles/EliseWithSAPLogoTeeth.jpg";
import { useState } from "react";

// Simple carousel component
function ImageCarousel({ images }) {
  const [current, setCurrent] = useState(0);
  const next = () => setCurrent((current + 1) % images.length);
  const prev = () => setCurrent((current - 1 + images.length) % images.length);

  return (
    <div className="carousel-container">
      <button className="carousel-arrow" onClick={prev} aria-label="Previous Image">
        &#8249;
      </button>
      <div className="carousel-image-wrapper">
        <img src={images[current].src} alt={images[current].alt} className="carousel-image" />
        <div className="carousel-caption">{images[current].caption}</div>
      </div>
      <button className="carousel-arrow" onClick={next} aria-label="Next Image">
        &#8250;
      </button>
    </div>
  );
}

function Home() {
  const carouselImages = [
    {
      src: eliseAtComputer,
      alt: "Elise working at computer at SAP",
      caption: "Problem-solving at my desk"
    },
    {
      src: eliseAtWhiteboard,
      alt: "Elise at SAP whiteboard",
      caption: "Collaborating at the whiteboard"
    },
    // More images can be added here
  ];

  return (
    <div className="Home">
      {/* Hero section */}
      <div className="hero-banner">
        <img src={bannerImage} alt="Banner" className="hero-img" />
        <div className="hero-overlay">
          <div className="hero-content">
            <h1 className="hero-title">Elise Pitre</h1>
            <h2 className="hero-subtitle">SAP CI/CD Pipeline Developer Co-op Portfolio</h2>
            <div className="hero-links">
              <a href="#work-term-1">Work Term</a>
              <a href="#contact">Contact</a>
              <a href="https://www.linkedin.com/in/elise-pitre" target="_blank" rel="noopener noreferrer">LinkedIn</a>
              <a href="mailto:elisempitre@gmail.com">Email</a>
            </div>
          </div>
        </div>
      </div>

      {/* Welcome Section, now with extra spacing below hero */}
      <section id="welcome" className="section welcome-section spaced-section">
        <h2>Welcome</h2>
        <p>
          Welcome to my co-op portfolio! Here you'll find my experiences, skills, and reflections from my SAP work terms. 
          Explore the projects, roles, and growth throughout my journey!
        </p>
      </section>

      {/* Work Term 1 Section */}
      <section id="work-term-1" className="section work-term-section">
        <div className="work-term-layout">
          <div className="work-term-info">
            <h2>Work Term 1: SAP CI/CD Pipeline Developer</h2>
            <p>
              My first SAP work term focused on CI/CD pipeline automation, collaboration, and technical growth. I worked with a team to improve deployment processes, documentation, and cross-functional communication.
            </p>
            <h3>Key Highlights</h3>
            <ul>
              <li>Built automated CI/CD pipelines for efficient deployment cycles</li>
              <li>Collaborated with developers and QA to enhance workflow</li>
              <li>Documented new processes and trained team members</li>
            </ul>
            <h3>Skills Developed</h3>
            <ul>
              <li>Teamwork & Agile Collaboration</li>
              <li>Problem-solving with technical tools</li>
              <li>Continuous Integration & Deployment</li>
            </ul>
          </div>
          <div className="work-term-media">
            <div className="media-row">
              <img src={eliseWithSAPLogoTeeth} alt="Elise with SAP Logo Teeth" className="media-profile" />
              <ImageCarousel images={carouselImages} />
            </div>
          </div>
        </div>
      </section>

      {/* Contact Section */}
      <section id="contact" className="section contact-section">
        <h2>Contact</h2>
        <p>If you'd like to get in touch, reach out via email or LinkedIn!</p>
        <ul>
          <li>Email: <a href="mailto:elisempitre@gmail.com">elisempitre@gmail.com</a></li>
          <li>LinkedIn: <a href="https://www.linkedin.com/in/elise-pitre" target="_blank" rel="noopener noreferrer">linkedin.com/in/elise-pitre</a></li>
        </ul>
      </section>
    </div>
  );
}

export default Home;
